    false,nt"url": null,nt"notes": "This narrative report for Killcohook National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1961.
    The report begins by summarizing the weather conditions, habitat conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
    raptors, fish, and reptiles- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, vegetation control, and prescribed
    burning. Resource management is outlined; topics include haying and commercial fishing.
    The public relations section of the report describes recreational uses and Refuge
    visitors. Items of interest and N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
